# Andreyevka, Yamandinsky Selsoviet, Yanaulsky District, Republic of Bashkortostan

}}
Andreyevka () is a rural locality (a selo) in Yamadinsky Selsoviet, Yanaulsky District, Bashkortostan, Russia. The population was 357 as of 2010.
Geography
It is located 37&nbsp;km from Yanaul, 3&nbsp;km from Yamady.
